INSERT INTO `agenda` (`id_agenda`, `nama`, `keterangan`) VALUES
(10, 'Menentukan Akar Persamaan dengan Metode Bisection menggunakan Program Matlab', 'A. Pengertian Metode Bisection Metode bisection atau metode bagi dua membagi interval ( antara x1 dan x2 pada suatu fungsi f(x) ) dimana diperkirakan terdapat sebuah akar, menjadi 2 subinterval yang sama besar. Akar tersebut dicari dalam salah satu subinterval dan interval tidak boleh terlalu lebar. B. Alogaritma Metode Biection Langkah 1 : Pilih taksiran nilai a sebagai batas bawah interval dan taksiran nilai b sebagai batas atas interval. Jika terpenuhi kondisi : f(a) x f(b) < 0 ; maka ada akar dalam interval, selanjutnya ke langkah 2. f(a) x f(b) > 0 ; maka tidak ada akar dalam interval. Geser posisi interval. f(a) x f(b) = 0 ; maka a dan b, salah satu merupakan akar. Langkah 2 : Taksiran akar yang pertama c dimana, c = (a + b )/2 Langkah 3 : Evaluasi keberadaan akar, apakah dalam subinterval pertama (antara a dan c ) atau dalam subinterval kedua (antara c dan b). Jika diperoleh : f(a) x f(c) < 0 ; akar berada dalam subinterval pertama, maka b = c. selanjutnya ke langkah 4. f(a) x f(c) > 0 ; akar berada dalam subinterval ke dua, maka a = c. Selanjutnya ke langkah 4. f(a) x f(c) = 0 ; c adalah akar. Langkah 4 : Kembali ke langkah 2 dan proses hingga langkah 3. C. Program Matlab 6.5 Dengan bantuan komputer, langkah-langkah metode numeric dari alogaritma diformulasikan menjadi suatu program. Berikut ini adalah program MATLAB mencari akar-akar persamaan dengan metode Bisection : D. Uji Program 1. Program akan diuji untuk persamaan f(x) = x2  x  6 = 0 a. Cara analitik (pemaktoran) : x2 - x  6 = 0 (x + 2) (x  3) = 0 x1 = -2 atau x 2 = 3 jadi secara analitik/ pemaktoran diperoleh akar x1 = -2 atau x 2 = 3 b. Mencari akar secara numerik dengan Metode Bisection dengan Program Matlab 6.5 Petunjuk : Ketik nama file syahwil5 pada jendela command window, Masukkan persamaan (huruf x kecil) = x^2-x-6 Masukkan batas bawah a = -3 Masukkan batas atas b = 2 Perhatikan output program, seperti gambar berikut dari hasil keluaran program terlihat bahwa salah satu akar persamaan diatas adalah -2, untuk mengetahui akar yang lain masukkan nilai batas ats dan batas bawah yang lain. 2. Hasil keluaran program benar, maka akan diuji lagi untuk persamaan berikut : f(x) = x3  x  6 = 0 f(x) = x2.5  x  6 = 0 Uji program : a. Akar Persamaan f(x) = x3  x  6 = 0 Petunjuk : 1. Ketik nama file syahwil5 pada jendela command window, Masukkan persamaan (huruf x kecil): x^3-x-6 Masukkan batas bawah a = -1 Masukkan batas atas b = 3 Perhatikan output program, seperti gambar berikut a. Output program akar persamaan f(x) = x3  x  6 = 0 keluaran program terlihat akar persamaannya adalah 2 b. Output program akar persamaan f(x) = x2.5  x  6 = 0 akar persamaannya adalah 2,33 D. Ciri-ciri penyelesaian Numerik bila dibanding dengan penyelesaian Analitik yaitu : Adanya proses perhitungan yang berulang-ulang (iteratif). Memerlukan alat bantu komputer. Memerlukan pemodelan matematis dari situasi yang nyata. Penyediaan input dan data yang cukup bagi pemodelan. Pembuatan algoritma dan penulisan program. Jawaban-jawaban yang diperoleh berupa jawaban (nilai) pendekatan, sehingga memiliki tingkat kesalahan/error (namun mempunyai tingkat ketelitian yang bisa diterima/valid)\r\n\r\nToday Deal $50 Off : https://goo.gl/efW8Ef'),
(11, '\r\n\r\nTuesday, September 20, 2016\r\nMengenal Big Data', 'Big Data sepengetahuan saya sedang ramai dibicarakan dan dipelajari. Komunitasnya pun mulai menjamur dimana-mana. Pertama kali pada akhir bulan Juli di tahun 2016 saya mendengar istilah Big Data, sementara baru pada bulan Agustusnya saya mengikuti #10MeetUp yang diadakan oleh Komunitas Big Data Indonesia (IDBigData [1]) di Fakultas Teknik Universitas Diponegoro\r\n\r\nUnduh materi lebih lengkap: masfebaryanto-mengenal-bigdata\r\n(Visited 108 times, 6 visits today)\r\n\r\nRelated Articles\r\n\r\n    Mengenal District Health Information System 2 (DHIS2)\r\n    CompFest 2013\r\n    Menampilkan Google Map di Dalam Website atau Blog\r\n    ADO.NET Tutorial\r\n    Bermain-main Dengan Simputer dan Embedded Linux\r\n    Menampilkan Twitter Timeline di Website/Blog\r\n    Tutorial Web Database dengan ASP.NET dan VB.NET\r\n    Mengenal Datatypes Pada SQL Server 2005\r\n    Menampilkan Scrolling RSS Feed di Website Menggunakan FeedWind\r\n    Seri-2a Bootstrap: Semudah Apa Bootstrap?\r\n    Kuliah Sistem Operasi\r\n    Mudahnya Meng-Install Mikrotik 5.20 pada Vmware Player\r\n    CD Interaktif Dokumentasi Acara\r\n    Analisa Protokol E-mail (SMTP) dengan Wireshark\r\n    Membangun Aplikasi PHP Tanpa OOP\r\n    Indowebster.com, Penyedia Layanan File Sharing\r\n    Memanfaatkan Google Dibanding Perpustakaan\r\n    Cara Membuat Game Berbasis Java Menggunakan Greenfoot Bag. 2\r\n    Membangun Website Edutainment\r\n    Teknik Menyembunyikan Folder 2\r\n\r\n'),
(12, '\r\n\r\nTuesday, September 20, 2016\r\nMembuat Aplikasi Desktop Client Server Sederhana dengan Java RMI', 'Pada artikel ini kita akan membahas mengenai pembuatan aplikasi desktop berbasis Client Server dengan bahasa Program Java dan RMI.\r\n\r\nIstilah client/server pertama kali digunakan pada tahun tahun 1980-an dalam mereferensikan suatu Personal Computer pada suatu jaringan. Model client/server yang sebenarnya mulai diterima pada akhir tahun 1980-an. Arsitektur perangkat lunak client/server adalah infrastruktur modular dan message-based yang sangat berguna, dimaksudkan untuk meningkatkan usability, flexibility, interoperability, dan scalability.\r\n\r\nRMI (Remote Method Invocation) menyediakan sarana dimana client dan server dapat berkomunikasi dan saling bertukar infomasi. RMI memungkinkan pengembang perangkat lunak untuk merancang aplikasi terdistribusi dimana methods dari remote object dapat dipanggil dari JVM (Java Virtual Mechine) lain, yang mungkin berjalan\r\npada host yang berbeda. Remote object adalah obyek dalam Java yang dapat direferensikan secara remote. Pemrogram seakan- akan memanggil methods lokal dari file kelas lokal, sedang dalam kenyataannya semua argumen dikirimkan ke remote target dan diinter-pretasikan, kemudian hasilnya dikirimkan kembali ke pemanggil. Dalam RMI, server akan membuat remote objects, membuat referensi, dan menunggu client untuk memanggil methods dari remote object ini. Sedangkan client akan mendapatkan remote reference dari satu atau lebih remote object dan memanggil methods untuk remote object tersebut.\r\n\r\nDownload Ebook & Sourcecode : Membuat Aplikasi Desktop Client Server Sederhana dengan Java RMI\r\n\r\n \r\n(Visited 524 times, 4 visits today)\r\n\r\nRelated Articles\r\n\r\n    Membuat Aplikasi Converter Suhu dengan Memanfaatkan CORBA\r\n    Membuat Repo Lokal Ubuntu Via Rsync\r\n    Monitoring Client  Server dengan VNC\r\n    Membuat Installer dari Project Java Desktop dengan Advanced Installer\r\n    James Gosling\r\n    Generate UML dari Kode Java Menggunakan Netbeans\r\n    POP dan IMAP\r\n    Pengenalan Visual Studio LightSwitch HTML Client\r\n    Menginstall Mail Server pada SO Debian 6.0 serta Membuka Konfigurasi Mail Server di PC Client (Win 2003)\r\n    Pengenalan Iphost Network Monitor\r\n    Menginstall FTP Server pada Debian 6.0 dan Menggunakan Aplikasi FTP Server di PC Client (Win 2003)\r\n    Instalasi Radmin Server pada Windows\r\n    Mobile Business Untuk Aplikasi Horoscope Menggunakan Web Service dan J2ME\r\n    Tutorial Database Kemahasiswaan Menggunakan Teknologi AJAX, PHP & MySQL\r\n    Trik Matikan Komputer Dengan Klik Kanan\r\n    Instalasi Mikrotik Versi 5.20 pada VirtualBox\r\n    Bekenalan dengan AJAX\r\n    Instalasi Sistem Operasi Windows Server 2008\r\n    Menyalin Tabel dan Field dari Dalam Project PHPMaker\r\n    Setting DHCP Server di Debian Woody\r\n'),
(13, 'Update Status Facebook via Facebook for BlackBerry\r\n', 'Pernahkah anda melihat status teman anda di facebook..kalau dia update status via blackberry, via ipad, via iphone dll..dimana dibawah postingannya tertulis via Blackberry, Via mobile phone dan lain-lain...mungkin saja memang status fb nya diposting dari smartpohone BB atau iphone,,namun tanpa handphone BB pun kita juga bisa membuat status di fb dari laptop kita seolah-olah kita menggunakan handphone tersebut. Untuk Update Status Facebook via Facebook for Blackberry tak perlu susah-susah, tinggal tulis statusmu di sini.....otomatis langsung postinganmu facebookmu via Blackberry.\r\n\r\nToday Deal $50 Off : https://goo.gl/efW8Ef'),
(14, 'FACTS sebagai Teknologi Transmisi Masa Depan\r\n\r\nToday Deal $50 Off : https://goo.gl/efW8Ef', 'Pengoperasian sistim jaringan transmisi daya listrik kini telah memasuki era baru. Dalam tahapan baru ini, transmisi daya listrik tidak hanya akan menjadi lebih terjamin dan lebih terkendali dalam pengaturannya, tetapi juga akan menjadi jauh lebih efisien dalam pemanfaatannya. Peningkatan pesat ke arah pemanfaatan sistim jaringan transmisi listrik secara optimal ini dimungkinkan dengan keberadaan dan semakin dewasanya aplikasi teknologi dibidang elektronika daya pada khususnya dan teknologi semikonduktor pada umumnya. Teknologi kendali terbaru untuk transmisi daya listrik ini populer dengan sebutan FACTS singkatan dari Flexible AC Transmission System dan pertama kali dikembangkan oleh Electric Power Research Institute (EPRI) di Palo Alto negara bagian California di Amerika Serikat. Pada awal pengembangannya, teknologi FACTS ditujukan untuk menjawab permasalahan dalam peningkatan kapasitas pengaliran daya listrik pada sistim jaringan transmisi dan juga untuk menyediakan peralatan kendali daya listrik yang terpercaya pada jalur transmisi yang diinginkan.\r\n\r\nToday Deal $50 Off : https://goo.gl/efW8Ef'),
(15, 'Kiat Sukses Membangun Kepercayaan Diri\r\n\r\nToday Deal $50 Off : https://goo.gl/efW8Ef', 'Banyak ahli menilai, percaya diri merupakan faktor penting yang menimbulkan perbedaan besar antara sukses dan gagal. Karenanya, tidak sedikit pula yang memberikan pandangannya mengenai teknik-teknik membangkitkan rasa percaya diri. Dalam dimensi yang sangat luas, sukses adalah milik semua orang. Tetapi, tidak semua orang tahu bagaimana cara mendapatkan atau meraih kesuksesan. Kebanyakan orang menilai bahwa kesuksesan adalah milik orang-orang yang ber-IQ tinggi, lulusan sekolah terbaik dan memilih spesialisasi yang paling terkenal. Penilaian ini memang tidak sepenuhnya salah, tetapi kita juga harus melihat fenomena yang lebih luas, bahwa tidak sedikit orang-orang sukses yang tidak mengenyam pendidikan tinggi. Dengan kata lain, IQ tinggi, lulusan sekolah terbaik dan spesialisasi yang terkenal hanyalah bagian dari penunjang kesuksesan.\r\n\r\nToday Deal $50 Off : https://goo.gl/efW8Ef'),
(16, 'Pembangkit Listrik Tenaga Matahari Terbesar di Dunia Mulai Beroperasi\r\n\r\nToday Deal $50 Off : https://goo.gl/efW8Ef', 'Pembangkit listrik tenaga matahari terbesar di dunia yang terletak di Shanghai mulai beroperasi. Pembangkit yang menggunakan 20 ribu panel surya photovoltaic bisa mengalirkan listrik hingga 6,3 juta kwh per tahun. Aliran listrik itu untuk memenuhi kebutuhan listrik 12 ribu rumah tangga di Shanghai. Panel tenaga surya menempati area seluas 61 ribu meter persegi dan telah menghasilkan 300 ribu kwh sejak proyek senilai 160 juta Yuan ini beroperasi dua minggu lalu. Terobosan ini akan mengurangi penggunaan batu bara sebesar 2.254 ton dan mengurangi emisi gas karbon sebesar 6.600 ton. "Proyek ini menjadi pembuktian pada komitmen China untuk mengurangi emisi karbon untuk memerangi dampak perubahan iklim," kata Yu Hailong, General Manager of the Beijing-based China Energy Conservation and Environmental Protection Group (CECEP). selengkapnya lihat\r\n\r\nToday Deal $50 Off : https://goo.gl/efW8Ef'),
(17, 'Listrik dari Buah Belimbing, Mungkinkah?\r\n\r\nToday Deal $50 Off : https://goo.gl/efW8Ef', 'MAGETAN - Sunarto (40), warga Desa Nguntoronadi, Kecamatan Nguntoronadi, Kabupaten Magetan, Jawa Timur, mampu menciptakan tenaga listrik dari bahan dasar larutan air belimbing wuluh. Belimbing wuluh yang tumbuh subur di pekarangan rumahnya ia sulap menjadi zat pengurai yang mampu menghasilkan tenaga listrik alternatif di tengah keluhan warga atas naiknya tarif dasar listrik (TDL) sejak awal Juli lalu. "Pengembangan tenaga listrik dari larutan belimbing wuluh ini berawal dari rasa prihatin atas tarif dasar listrik yang terus naik. Apalagi, masih banyak warga Indonesia di daerah pedalaman yang belum tersentuh listrik, ujar pencipta energi listrik dari belimbing wuluh, Sunarto, Selasa (13/7/2010). lengkapnya klik link berikut\r\n\r\nToday Deal $50 Off : https://goo.gl/efW8Ef'),
(25, 'ACCELEROMETER & GYROSCOPE ', 'Mungkin dari kalian udah penah menggunakan bahkan punya gadged yg ada accelerometer & gyroscope, tp blm tau kalau itu adalah accelorometer & gyroscope...\r\nIni dia pejelasannya....\r\n\r\nPengertian accelerometer\r\n\r\nAccelerometer adalah sensor yang digunakan untuk mengukur percepatan suatu objek. Accelometer mengukur percepatan dynamic dan static. Pengukuran dynamic adalah pengukuran percepatan pada objek bergerak, sedangkan pengukuran static adalah pengukuran terhadap gravitasi bumi. Untuk mengukur sudut kemiringan (tilt).\r\n\r\nSedangkan Prinsip kerja dari Accelerometer yaitu....\r\n\r\nPrinsip kerja yang digunakan adalah prinsip percepatan (acceleration). Sebuah per dengan beban dan dilepaskan , beban bergerak dengan suatu percepatan sampai kondisi tertentu akan berhenti. Bila ada sesuatu yang menggoncangkannya maka beban akan berayun kembali.\r\n\r\nPengukuran  kapasitansi inilah yang umumnya menjadi hasil pengukuran chip. Agar sensor bisa mendeteksi 3 dimensi, maka dibutuhkan 3 pasang plat yang dipasang tegak lurus antar masing- masing. Maka sensor ini bisa mendeteksi gerak alunan lagu anak geser kiri, geser kanan, putar ke kiri putar ke kanan , lompat ke depan.\r\n\r\n Apa sihh fungsi dari accelerometer....?????\r\n\r\n1.     Accelerometer ponsel ada yang namanya fungsi shake control,dengan fungsi ini maka dengan hanya menggoyangkan ponsel kita bisa mengubah fitur, misalnya mengubah lagu yang sedang di putar ke lagu selanjutnya atau lagu sebelumnya.\r\n\r\n2.    permainan video menggunakan kontroler Wii Remote disebut yang berisi accelerometer dan dirancang terutama untuk input gerak. Pengguna juga memiliki pilihan untuk membeli sebuah gerak-sensitif tambahan lampiran, sehingga masukan gerak bisa dicatat dari kedua tangan pengguna.\r\n\r\n\r\n3.    Untuk  kontrol antarmuka pengguna, sering accelerometer digunakan untuk menyajikan pandangan landscape atau potret layar perangkat, berdasarkan cara perangkat sedang diadakan. Misalnya mengganti tampilan layar dari vertical (portrait) menjadi horizontal (landscape).\r\n\r\n4.    Kamera video juga memanfaatkan accelerometer untuk menstabilkan tangkapan gambar (image stabilization), untuk anti-blur saat menangkap gambar.\r\n\r\n5.    Pada  kamera foto memanfaatkannya untuk mencegah hasil pemotretan buram. Contoh penggunaan aplikasi ini adalah seperti yang terdapat pada Nokia N95. Beberapa kamera digital seperti Canon PowerShot dan Ixus dilengkapi dengan accelerometer untuk mengatur format foto dan merotasi hasil pemotretan saat preview.\r\n\r\n6.    Penggunaan lain accelerometer adalah sebagai pedometer , atau penghitung langkah. Dipakai di banyak gadget sebagai monitor banyaknya langkah saat berolah raga. Apple dan Nike bekerjasama mengeluarkan produk sepatu yang bisa berkomunikasi dengan pemutar lagu Ipod, mengirimkan banyak langkah, jumlah kalori terbakar, waktu bergerak.\r\n\r\nAccelerometer sendiri mempunyai kekurangan dan kelebihan yaitu:\r\n\r\n1.     Hanya dapat membacaca dalam 2 sumbu, yaitu atas dan bawah karena d pengaruhi oleh gravitasi.\r\n2.    Membutuhkan penggunaan listrik yang tinggi(boros baterai).\r\n3.    Gerakan lebih patah-patah/ tidak halus seperti pada gyroscope.\r\n4.    accelerometer tidak bisa mengikuti pergerakan yang cepat dikarenakan responnya yang lamban.\r\n5.    Accelerometer dapat memberikan pengukuran sudut tegak lurus yang akurat ketika  sistem sedang diam (statis)\r\n\r\n\r\nUdah tau tentang accelerometer... nah,,, sekarang penjelasan tentang Gyroscope....\r\n\r\nPengertian dari gyroscope,,\r\n\r\nSebagai pengenalan, giroskop adalah perangkat untuk mengukur atau mempertahankan orientasi, dengan prinsip ketetapan momentum sudut. Mekanismenya adalah sebuah roda berputar dengan piringan didalamya yang tetap stabil. Giroskop sering digunakan pada robot atau heli dan alat-alat cangggih lainnya.\r\nGyroscope adalah berupa sensor gyro untuk menentukan orientasi gerak dengan bertumpu pada roda atau cakram yang berotasi dengan cepat pada sumbu.Jadi bagaimana dengan Giro sensor? Gyro sensor bisa mendeteksi gerakan sesuai gravitasi, atau dengan kata lain mendeteksi gerakan pennguna. Kita bisa membayangkan sebuah game pertempuran, sebelum ini bila kita ingin melihat situasi sekeliling, kita akan menyapu layar searah terus menerus untuk berputar, dengan gyro sensor ini kita cukup berputar sesuai gravitasi seperti benar-benar melihat sekeliling. Atau bila melihat sebuah obyek 3D kita cukup berputar untuk melihat setiap sudut obyek tersebut. Tentu ini adalah sebuah metode yang menghasilkan pengalaman seolah nyata.\r\n \r\n\r\nSeadangkan Prinsip kerja Gyroscope yaituu....\r\n\r\nGyro sensor bisa mendeteksi gerakan sesuai gravitasi, atau dengan kata lain mendeteksi gerakan pennguna.\r\n\r\nGyroscope pada penelitian ini digunakan untuk mengukur sumbu rotasi roket. Sebelum digunakan, sensor gyroscope terlebih dahulu dilakukan proses kalibrasi dengan menggunakan bandul. Proses kalibrasi tersebut berfungsi untuk memperoleh nilai faktor kalibrasi. Gyroscope memiliki keluaran berupa kecepatan sudut dari arah 3 sumbu yaitu: sumbu x yang nantinya akan menjadi sudut phi (kana dan kiri) dari sumbu y nantinya menjadi sudut theta (atas dan bawah), dan sumbu z nantinya menjadi sudut psi (depan dan belakang).\r\n\r\nTernyata gyroscope udah digunakan dari dulu lohh..\r\nKegunaan dari gyroscope pada pengembangan teknologi & gadjed yaitu:\r\n\r\n1.     Di masa lalu, gyros telah digunakan untuk ruang navigasi, kontrol rudal, di bawah bimbingan-air, dan bimbingan penerbangan..\r\n2.    Sebuah giroskop di sisi lain memiliki kemampuan mengukur tingkat rotasi di sekitar sumbu tertentu. Sebagai contoh jika giroskop yang digunakan untuk mengukur laju rotasi di sekitar sumbu gulungan pesawat terbang.\r\n3.    Penggunaan pada game contohnya adalah sebuah game pertempuran, sebelum ini bila kita ingin melihat situasi sekeliling, kita akan menyapu layar searah terus menerus untuk berputar, dengan gyro sensor ini kita cukup berputar sesuai gravitasi seperti benar-benar melihat sekeliling. Atau bila melihat sebuah obyek 3D kita cukup berputar untuk melihat setiap sudut obyek tersebut. Tentu ini adalah sebuah metode yang menghasilkan pengalaman seolah nyata.\r\n4.    Biasanya giroskop yang digunakan untuk mengukur posisi sudut didasarkan pada prinsip kekakuan ruang giroskop. Sebuah giroskop telah banyak aplikasi praktis. Sekarang mereka mulai digunakan bersama akselerometer untuk aplikasi seperti gerak-capture dan navigasi kendaraan\r\n\r\ndibandingkan dengan accelerometer gyroscope punya Kelebihan dan kekurangan yaitu.....^^\r\n\r\n1.     Harganya yang mahal.\r\n2.    Hanya dapat digunakan jika ada accelerator.\r\n3.    Dapat mendeteksi gerakan dari segala arah.\r\n4.     Hasil gambar yg di hasilkan dari gerakan lebih halus/ tidak patah-patah seperti pada accelerometer.\r\n5.    Tidak di pengaruhi oleh gravitasi.\r\n\r\n\r\nSekian dulu penjelasannya.... semoga artikel ini bermanfaat buat kalian yang baca,,\r\n'),
(26, 'ACCELEROMETER & GYROSCOPE ', 'Mungkin dari kalian udah penah menggunakan bahkan punya gadged yg ada accelerometer & gyroscope, tp blm tau kalau itu adalah accelorometer & gyroscope...\r\nIni dia pejelasannya....\r\n\r\nPengertian accelerometer\r\n\r\nAccelerometer adalah sensor yang digunakan untuk mengukur percepatan suatu objek. Accelometer mengukur percepatan dynamic dan static. Pengukuran dynamic adalah pengukuran percepatan pada objek bergerak, sedangkan pengukuran static adalah pengukuran terhadap gravitasi bumi. Untuk mengukur sudut kemiringan (tilt).\r\n\r\nSedangkan Prinsip kerja dari Accelerometer yaitu....\r\n\r\nPrinsip kerja yang digunakan adalah prinsip percepatan (acceleration). Sebuah per dengan beban dan dilepaskan , beban bergerak dengan suatu percepatan sampai kondisi tertentu akan berhenti. Bila ada sesuatu yang menggoncangkannya maka beban akan berayun kembali.\r\n\r\nPengukuran  kapasitansi inilah yang umumnya menjadi hasil pengukuran chip. Agar sensor bisa mendeteksi 3 dimensi, maka dibutuhkan 3 pasang plat yang dipasang tegak lurus antar masing- masing. Maka sensor ini bisa mendeteksi gerak alunan lagu anak geser kiri, geser kanan, putar ke kiri putar ke kanan , lompat ke depan.\r\n\r\n Apa sihh fungsi dari accelerometer....?????\r\n\r\n1.     Accelerometer ponsel ada yang namanya fungsi shake control,dengan fungsi ini maka dengan hanya menggoyangkan ponsel kita bisa mengubah fitur, misalnya mengubah lagu yang sedang di putar ke lagu selanjutnya atau lagu sebelumnya.\r\n\r\n2.    permainan video menggunakan kontroler Wii Remote disebut yang berisi accelerometer dan dirancang terutama untuk input gerak. Pengguna juga memiliki pilihan untuk membeli sebuah gerak-sensitif tambahan lampiran, sehingga masukan gerak bisa dicatat dari kedua tangan pengguna.\r\n\r\n\r\n3.    Untuk  kontrol antarmuka pengguna, sering accelerometer digunakan untuk menyajikan pandangan landscape atau potret layar perangkat, berdasarkan cara perangkat sedang diadakan. Misalnya mengganti tampilan layar dari vertical (portrait) menjadi horizontal (landscape).\r\n\r\n4.    Kamera video juga memanfaatkan accelerometer untuk menstabilkan tangkapan gambar (image stabilization), untuk anti-blur saat menangkap gambar.\r\n\r\n5.    Pada  kamera foto memanfaatkannya untuk mencegah hasil pemotretan buram. Contoh penggunaan aplikasi ini adalah seperti yang terdapat pada Nokia N95. Beberapa kamera digital seperti Canon PowerShot dan Ixus dilengkapi dengan accelerometer untuk mengatur format foto dan merotasi hasil pemotretan saat preview.\r\n\r\n6.    Penggunaan lain accelerometer adalah sebagai pedometer , atau penghitung langkah. Dipakai di banyak gadget sebagai monitor banyaknya langkah saat berolah raga. Apple dan Nike bekerjasama mengeluarkan produk sepatu yang bisa berkomunikasi dengan pemutar lagu Ipod, mengirimkan banyak langkah, jumlah kalori terbakar, waktu bergerak.\r\n\r\nAccelerometer sendiri mempunyai kekurangan dan kelebihan yaitu:\r\n\r\n1.     Hanya dapat membacaca dalam 2 sumbu, yaitu atas dan bawah karena d pengaruhi oleh gravitasi.\r\n2.    Membutuhkan penggunaan listrik yang tinggi(boros baterai).\r\n3.    Gerakan lebih patah-patah/ tidak halus seperti pada gyroscope.\r\n4.    accelerometer tidak bisa mengikuti pergerakan yang cepat dikarenakan responnya yang lamban.\r\n5.    Accelerometer dapat memberikan pengukuran sudut tegak lurus yang akurat ketika  sistem sedang diam (statis)\r\n\r\n\r\nUdah tau tentang accelerometer... nah,,, sekarang penjelasan tentang Gyroscope....\r\n\r\nPengertian dari gyroscope,,\r\n\r\nSebagai pengenalan, giroskop adalah perangkat untuk mengukur atau mempertahankan orientasi, dengan prinsip ketetapan momentum sudut. Mekanismenya adalah sebuah roda berputar dengan piringan didalamya yang tetap stabil. Giroskop sering digunakan pada robot atau heli dan alat-alat cangggih lainnya.\r\nGyroscope adalah berupa sensor gyro untuk menentukan orientasi gerak dengan bertumpu pada roda atau cakram yang berotasi dengan cepat pada sumbu.Jadi bagaimana dengan Giro sensor? Gyro sensor bisa mendeteksi gerakan sesuai gravitasi, atau dengan kata lain mendeteksi gerakan pennguna. Kita bisa membayangkan sebuah game pertempuran, sebelum ini bila kita ingin melihat situasi sekeliling, kita akan menyapu layar searah terus menerus untuk berputar, dengan gyro sensor ini kita cukup berputar sesuai gravitasi seperti benar-benar melihat sekeliling. Atau bila melihat sebuah obyek 3D kita cukup berputar untuk melihat setiap sudut obyek tersebut. Tentu ini adalah sebuah metode yang menghasilkan pengalaman seolah nyata.\r\n \r\n\r\nSeadangkan Prinsip kerja Gyroscope yaituu....\r\n\r\nGyro sensor bisa mendeteksi gerakan sesuai gravitasi, atau dengan kata lain mendeteksi gerakan pennguna.\r\n\r\nGyroscope pada penelitian ini digunakan untuk mengukur sumbu rotasi roket. Sebelum digunakan, sensor gyroscope terlebih dahulu dilakukan proses kalibrasi dengan menggunakan bandul. Proses kalibrasi tersebut berfungsi untuk memperoleh nilai faktor kalibrasi. Gyroscope memiliki keluaran berupa kecepatan sudut dari arah 3 sumbu yaitu: sumbu x yang nantinya akan menjadi sudut phi (kana dan kiri) dari sumbu y nantinya menjadi sudut theta (atas dan bawah), dan sumbu z nantinya menjadi sudut psi (depan dan belakang).\r\n\r\nTernyata gyroscope udah digunakan dari dulu lohh..\r\nKegunaan dari gyroscope pada pengembangan teknologi & gadjed yaitu:\r\n\r\n1.     Di masa lalu, gyros telah digunakan untuk ruang navigasi, kontrol rudal, di bawah bimbingan-air, dan bimbingan penerbangan..\r\n2.    Sebuah giroskop di sisi lain memiliki kemampuan mengukur tingkat rotasi di sekitar sumbu tertentu. Sebagai contoh jika giroskop yang digunakan untuk mengukur laju rotasi di sekitar sumbu gulungan pesawat terbang.\r\n3.    Penggunaan pada game contohnya adalah sebuah game pertempuran, sebelum ini bila kita ingin melihat situasi sekeliling, kita akan menyapu layar searah terus menerus untuk berputar, dengan gyro sensor ini kita cukup berputar sesuai gravitasi seperti benar-benar melihat sekeliling. Atau bila melihat sebuah obyek 3D kita cukup berputar untuk melihat setiap sudut obyek tersebut. Tentu ini adalah sebuah metode yang menghasilkan pengalaman seolah nyata.\r\n4.    Biasanya giroskop yang digunakan untuk mengukur posisi sudut didasarkan pada prinsip kekakuan ruang giroskop. Sebuah giroskop telah banyak aplikasi praktis. Sekarang mereka mulai digunakan bersama akselerometer untuk aplikasi seperti gerak-capture dan navigasi kendaraan\r\n\r\ndibandingkan dengan accelerometer gyroscope punya Kelebihan dan kekurangan yaitu.....^^\r\n\r\n1.     Harganya yang mahal.\r\n2.    Hanya dapat digunakan jika ada accelerator.\r\n3.    Dapat mendeteksi gerakan dari segala arah.\r\n4.     Hasil gambar yg di hasilkan dari gerakan lebih halus/ tidak patah-patah seperti pada accelerometer.\r\n5.    Tidak di pengaruhi oleh gravitasi.\r\n\r\n\r\nSekian dulu penjelasannya.... semoga artikel ini bermanfaat buat kalian yang baca,,\r\n');
