INSERT INTO `blog` (`id_blog`, `title`, `content`) VALUES
(1, 'Cara Mudah Bermain Pokemon dengan PC', 'Pokemon Go merupakan suatu yang muncul di tahun tahun ini dan termasuk games android yang sangat popular di seluruh negara terutama di indonesia games pokemon go ini sangat di minati oleh warna negara kita tersendiri , banyak yang memainkan game ini dari mulai anak-anak, remaja, laki laki, perempuan, maupun orang dewasa kini sedang di gandrumi oleh semua kalangan , mungkin mengembalikan kenangan masa masa saat bermain game saat itu dan ingin mersakannya kembali sekarang.\r\n\r\nDi dalam permainan Pokemon Go ini anda bertugas untuk mencari pokemon di sekitar anda dengan bantuan GPS untuk mencarinya di sekitar daerah anda tidak hanya sekedar bermain saja tetapi anda bisa sekalian  olah raga juga untuk mencari pokemon tetapi sayangnya bagi anda yang tidak bisa memainkannya di Smartphone kesayangan anda dikarenakan permainan ini tidak mendukung dengan Smartphone anda jadinya anda harus menggunakan Laptop atau Komputer untuk memainnkannya, Oleh sebab itu saya akan memberitahukan kepada anda bagaimana cara bermain pokemon go di laptop atau komputer anda, jangan kawatir bagi anda pengguna laptop atau komputer yang tidak bisa membawanya untuk pergi mencari pokemon saya ada solusinya juga ko tenang anda tidak perlu repot pergih jauh untuk mencari pokemon, anda hanya berdiam di depan layar bisa berpergian dengan bantuan aplikasi GPS di PC anda. - See more at: http://sumber-akuka.blogspot.com/2016/07/Bagaimana.Cara.Bermain.Pokemon.Go.Di.PC.Terbaru.html#sthash.YhHcXl2f.dpuf'),
(2, 'Cara Bermain Game PPSSPP di PC dan Android ', '\r\nHome / Info PPSSPP / Cara Bermain Game PPSSPP di PC dan Android\r\nCara Bermain Game PPSSPP di PC dan Android\r\nVocaloid Tangerang 9 months ago Info PPSSPP\r\n\r\nHallo gan, ketemu lagi dengan saya, kali ini saya akan membagikan tutorial bagaimana cara memainkan game psp di pc atau android,berikut tahap-tahap dalam memainkan game psp di pc atau di android :\r\n\r\nBahan-bahan yang di butuhkan untuk pc:\r\n> Emulator PPSSPP\r\n> Graphic Driver\r\n> Microsoft Visual C++ Redistributable 2013\r\n> Iso Game PSP\r\n\r\nBahan-bahan yang di butuhkan untuk android:\r\n> Emulator PPSSPP\r\n> Iso Game PSP\r\n\r\nDownload Link :\r\n\r\n\r\n\r\nTahap-tahap untuk pc :\r\n1. Download dan extract emulator ppsspp kedalam pc kalian\r\n2. Buka folder emulator ppsspp,lalu buka "ppsspp.exe"\r\n3. Extract game psp apabila game tersebut masih berbentuk rar hingga game berformat iso\r\ntutorial :\r\n\r\n4. Kemudian jalankan game iso tersebut menggunakan emulator ppsspp kalian,dan selesai.\r\n\r\nTahap-tahap untuk android :\r\n1. Download dan instal emulator ppsspp apk kedalam android kalian\r\n2. Buka emulator ppsspp di android\r\n3. Extract game psp apabila game tersebut masih berbentuk rar hingga game berformat iso\r\ntutorial :\r\n\r\n\r\n4. Kemudian jalankan game iso tersebut menggunakan emulator ppsspp kalian,dan selesai.\r\n\r\nSekian tutorial bagaimana cara bermain game ppsspp di pc dan adnroid kalian, semoga info yang saya berikan bermanfaat untuk kalian semua,bila ada sesuatu yang ingin kalian tanyakan silahkan berkomentar,terimakasih.\r\n'),
(3, 'Mod Texture Naruto Shippuden : Ultimate Ninja Impact [NSUNI] PPSSPP ', 'Hallo gan, ketemu lagi dengan saya, kali ini saya akan memberikan beberapa mod texture yang bisa kalian gunakan untuk game Naruto Shippuden : Ultimate Ninja Impact, Berikut Beberapa mod :\r\n\r\nWatch All Texture Mod In My Youtube Channel'),
(10, 'CARA MENGAKTIFKAN HIBERNATE PADA WINDOWS 8', ' Salam hangat untuk sobat blogger semua. Untuk postingan kali ini, saya akan mencoba membahas tentang cara menampilkan hibernate pada windows 8. Kebanyakan dari kita yang baru menggunakan windows 8 mungkin akan sedikit merasa adanya perbedaan dari versi sebelumnya (windows 7), khususnya ketika menekan icon power pada windows tersebut.\r\n\r\nDalam windows 7 pada icon power ada berbagai macam pilihan seperti restart, shutdown, sleep, hibernate dll. sedang untuk windows 8 hanya ada 3 opsi saja yaitu shutdown, hibernate dan sleep. oleh karena itu untuk melangkapi kekurangannya saya akan membahas tentang cara untuk mengaktikan hibernate.\r\nCara menampilkan hibernate pada windows 8\r\n\r\n    Pastikan laptop sobat sudah dalam keadaan On\r\n    Arahkan cursor pada icon baterai yang ada pojok bawah sebelah kanan selanjutnya klik kanan pada icon baterai lalu pilih Power Options\r\n    Kemudian akan muncul halaman power options lalu klik Require a password on wake-up \r\n    Selanjutnya klik tulisan Change settings that are currently unavailable untuk mengaktivkan kotak centangan dibawah seperti pada gambar\r\n    Lalu centang tulisan Hibernate kemudian klik save changes\r\n\r\nSekarang hibernate pada windows 8 anda sudah aktif sekarang tinggal anda cek pada icon power di laptop sobat, itulah tadi cara menampilkan hibernate pada windows 8. jangan lupa tinggalkan komentar dibawah ini ya... :)'),
