\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><span lang="IN" style="font-size: 11.0pt; line-height: 150%; font-family: ''Cambria'',''serif''; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: HGMinchoB; mso-fareast-theme-font: minor-fareast; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: ''Times New Roman''; mso-bidi-theme-font: minor-bidi; mso-ansi-language: IN; mso-fareast-language: JA; mso-bidi-language: AR-SA; mso-no-proof: yes;"><br style="mso-special-character: line-break; page-break-before: always;" clear="all" /> </span></p>\r\n<p class="MsoNormal" style="line-height: 150%;"><span lang="IN" style="font-size: 28.0pt; mso-bidi-font-size: 11.0pt; line-height: 150%; mso-ascii-font-family: Cambria; mso-ascii-theme-font: major-latin; mso-fareast-font-family: HGMinchoB; mso-fareast-theme-font: major-fareast; mso-hansi-font-family: Cambria; mso-hansi-theme-font: major-latin; mso-bidi-font-family: ''Times New Roman''; mso-bidi-theme-font: major-bidi; color: #2a7b88; mso-themecolor: accent1; mso-themeshade: 191; mso-font-kerning: 14.0pt; mso-ansi-language: IN; mso-no-proof: yes;">&nbsp;</span></p>\r\n<div style="mso-element: para-border-div; border: none; border-bottom: solid #39A5B7 1.5pt; mso-border-bottom-themecolor: accent1; padding: 0in 0in 4.0pt 0in;">\r\n<p class="MsoTitle" style="line-height: 150%;"><span lang="IN" style="mso-ansi-language: IN; mso-no-proof: yes;">BAB I : PENDAHULUAN</span></p>\r\n</div>\r\n<h1 style="text-align: justify; text-justify: inter-ideograph; line-height: 150%;"><span lang="IN" style="mso-ansi-language: IN; mso-no-proof: yes;">I. Latar Belakang</span></h1>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph; text-indent: .5in; line-height: 150%;"><span lang="IN" style="color: windowtext; mso-ansi-language: IN; mso-no-proof: yes;">Kemajuan teknologi saat ini sangat berkembang pesat dan membantu manusia untuk berinteraksi satu sama lain tanpa dibatasi oleh jarak dan waktu. Kemudahan yang diberikan oleh teknologi tersebut mencakup banyak hal serta merambah berbagai aspek kehidupan, mulai dari bisnis hingga pendidikan. Pada prinsipnya semua teknologi komunikasi ini berkembang untuk memenuhi kebutuhan dan keinginan manusia agar dalam kehidupannya dapat lebih mudah berkomunikasi ataupun melakukan sesuatu.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph; text-indent: .5in; line-height: 150%;"><span lang="IN" style="color: windowtext; mso-ansi-language: IN; mso-no-proof: yes;">Handphone merupakan salah satu dari perkembangan teknologi. Dengan kecanggihan teknologi saat ini, fungsi handphone tidak hanya sebagai alat komunikasi biasa, tetapi manusia juga dapat mengakses internet, SMS, berfoto dan juga saling mengirim data. Bahkan sekarang yang sedang marak adalah Smartphone yang sedang ramai-ramai digunakan dan memenuhi pasar karena banyaknya fitur yang tersedia dibandingkan dengan handphone biasa.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph; text-indent: .5in; line-height: 150%;"><span lang="IN" style="color: windowtext; mso-ansi-language: IN; mso-no-proof: yes;">Fungsi handphone pada saat ini sudah mulai bergeser. Dahulu handphone hanya digunakan untuk menelfon ataupun dengan menggunakan SMS (Short Message Service) untuk menyampaikan suatu pesan. Sekarang dengan kemajuan ilmu pengetahuan di bidang teknologi yang semakin modern, kini handphone telah berkembang bukan hanya sebagai alat untuk berkomunikasi. Adanya berbagai fitur yang tersedia dalam handphone, seperti adanya kamera, musik MP3, internet, dan fasilitas-fasilitas lainnya, masyarakat dapat menggunakannya bukan sekedar untuk berkomunikasi. </span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph; text-indent: .5in; line-height: 150%;"><span lang="IN" style="color: windowtext; mso-ansi-language: IN; mso-no-proof: yes;">Seiring dengan terus berkembangnya teknologi komunikasi dalam produksi handphone, kini berbagai jenis merek handphone dapat ditemui dengan harga yang semakin terjangkau. Banyak masyarakat tertarik untuk memiliki handphone yang kini sudah berubah menjadi smartphone. Tampilan smartphone dan fasilitas-fasilitas yang terdapat di dalam handphone, menjadi pertimbangan bagi masyarakat untuk membeli dan memilih smartphone yang akan digunakan. Sebagian orang beranggapan bahwa menggunakan smartphone terbaru dan tercanggih akan menambah kepercayaan diri. </span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph; text-indent: .5in; line-height: 150%;"><span lang="IN" style="color: windowtext; mso-ansi-language: IN; mso-no-proof: yes;">Dengan banyaknya masyarakat yang tertarik untuk mengikuti keluaran smartphone, terkadang orang menghalalkan berbagai cara unuk mendapatkan apa yang diinginkan, salah satunya aalah dengan mencuri. Maraknya pencurian yang terjadi khususnya pada smartphone membuat banyak orang berusaha untuk lebih meningkatkan system keamanan handphone dengan cara memasang berbagai aplikasi keamanan anti maling pada smartphone mereka.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph; text-indent: .5in; line-height: 150%;"><span lang="IN" style="color: windowtext; mso-ansi-language: IN; mso-no-proof: yes;">Dari latar belakang di atas, maka penulis memilih untuk mengulas software bernama Anti Theft Alarm yaitu salah satu software yang dapat digunakan oleh pengguna smartphone untuk mengamankan dan melindungi smartphone sebelum hilang atau dicuri.</span></p>\r\n<h1 style="text-align: justify; text-justify: inter-ideograph; line-height: 150%;"><span lang="IN" style="mso-ansi-language: IN; mso-no-proof: yes;">II. Rumusan Masalah</span></h1>\r\n<p class="MsoListNumberCxSpFirst" style="margin-left: .5in; mso-add-space: auto; text-indent: -14.7pt; mso-list: l4 level1 lfo6;"><span lang="IN" style="mso-fareast-font-family: Cambria; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: Cambria; mso-bidi-theme-font: minor-latin; color: windowtext; mso-ansi-language: IN;"><span style="mso-list: Ignore;">1.<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span lang="IN" style="color: windowtext; mso-ansi-language: IN; mso-no-proof: yes;">Bagaimana membu</span><span style="color: windowtext;">at soft</span><span lang="IN" style="color: windowtext; mso-ansi-language: IN;">ware Anti Theft Alarm?</span></p>\r\n<p class="MsoListNumberCxSpLast" style="margin-left: .5in; mso-add-space: auto; text-indent: -14.7pt; mso-list: l4 level1 lfo6;"><span lang="IN" style="mso-fareast-font-family: Cambria; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: Cambria; mso-bidi-theme-font: minor-latin; color: windowtext; mso-ansi-language: IN; mso-no-proof: yes;"><span style="mso-list: Ignore;">2.<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span lang="IN" style="color: windowtext; mso-ansi-language: IN;">Bagaimana penerap<span style="mso-no-proof: yes;">an metode SCRUM pada pembuatan software Anti Theft Alarm?</span></span></p>\r\n<h1 style="text-align: justify; text-justify: inter-ideograph; line-height: 150%;"><span lang="IN" style="mso-ansi-language: IN; mso-no-proof: yes;">III. Tujuan</span></h1>\r\n<p class="MsoListNumberCxSpFirst" style="margin-left: .5in; mso-add-space: auto; text-indent: -14.7pt; mso-list: l5 level1 lfo7;"><span lang="IN" style="mso-fareast-font-family: Cambria; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: Cambria; mso-bidi-theme-font: minor-latin; color: windowtext; mso-ansi-language: IN; mso-no-proof: yes;"><span style="mso-list: Ignore;">1.<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span lang="IN" style="color: windowtext; mso-ansi-language: IN; mso-no-proof: yes;">Membuat software Anti Theft Alarm?</span></p>\r\n<p class="MsoListNumberCxSpLast" style="margin-left: .5in; mso-add-space: auto; text-indent: -14.7pt; mso-list: l5 level1 lfo7;"><span lang="IN" style="mso-fareast-font-family: Cambria; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: Cambria; mso-bidi-theme-font: minor-latin; color: windowtext; mso-ansi-language: IN; mso-no-proof: yes;"><span style="mso-list: Ignore;">2.<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span lang="IN" style="color: windowtext; mso-ansi-language: IN; mso-no-proof: yes;">Menerapkan metode SCRUM pada pembuatan software Anti Theft Alarm?</span></p>\r\n<h1 style="text-align: justify; text-justify: inter-ideograph; line-height: 150%;"><span lang="IN" style="mso-ansi-language: IN; mso-no-proof: yes;">IV. Manfaat</span></h1>\r\n<p class="MsoListNumberCxSpFirst" style="margin-left: 35.45pt; mso-add-space: auto; text-align: justify; text-justify: inter-ideograph; text-indent: -.2in; line-height: 150%; mso-list: l6 level1 lfo2;"><span lang="IN" style="mso-fareast-font-family: Cambria; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: Cambria; mso-bidi-theme-font: minor-latin; color: windowtext; mso-ansi-language: IN; mso-no-proof: yes;"><span style="mso-list: Ignore;">1.<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp; </span></span></span><span lang="IN" style="color: windowtext; mso-ansi-language: IN; mso-no-proof: yes;">Mengembangkan software Anti Theft Alarm</span></p>\r\n<p class="MsoListNumberCxSpMiddle" style="margin-left: 35.45pt; mso-add-space: auto; text-align: justify; text-justify: inter-ideograph; text-indent: -.2in; line-height: 150%; mso-list: l6 level1 lfo2;"><span lang="IN" style="mso-fareast-font-family: Cambria; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: Cambria; mso-bidi-theme-font: minor-latin; color: windowtext; mso-ansi-language: IN; mso-no-proof: yes;"><span style="mso-list: Ignore;">2.<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp; </span></span></span><span lang="IN" style="color: windowtext; mso-ansi-language: IN; mso-no-proof: yes;">Menambah wawasan seputar metode SCRUM untuk pembuatan software Anti Theft Alarm</span></p>\r\n<p class="MsoListNumberCxSpLast" style="margin-left: 35.45pt; mso-add-space: auto; text-align: justify; text-justify: inter-ideograph; text-indent: -.2in; line-height: 150%; mso-list: l6 level1 lfo2;"><span lang="IN" style="mso-fareast-font-family: Cambria; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: Cambria; mso-bidi-theme-font: minor-latin; color: windowtext; mso-ansi-language: IN; mso-no-proof: yes;"><span style="mso-list: Ignore;">3.<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp; </span></span></span><span lang="IN" style="color: windowtext; mso-ansi-language: IN; mso-no-proof: yes;">Pengguna mengetahui cara bagaimana mengamankan dan melindungi smartphone dengan menggunakan aplikasi Anti Theft Alarm agar tidak hilang atau dicuri.</span></p>\r\n<p><span lang="IN" style="font-size: 11.0pt; line-height: 150%; font-family: ''Cambria'',''serif''; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: HGMinchoB; mso-fareast-theme-font: minor-fareast; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: ''Times New Roman''; mso-bidi-theme-font: minor-bidi; mso-ansi-language: IN; mso-fareast-language: JA; mso-bidi-language: AR-SA; mso-no-proof: yes;"><br style="mso-special-character: line-break; page-break-before: always;" clear="all" /> </span></p>\r\n<p class="MsoNormal" style="line-height: 150%;"><span lang="IN" style="font-size: 28.0pt; mso-bidi-font-size: 11.0pt; line-height: 150%; mso-ascii-font-family: Cambria; mso-ascii-theme-font: major-latin; mso-fareast-font-family: HGMinchoB; mso-fareast-theme-font: major-fareast; mso-hansi-font-family: Cambria; mso-hansi-theme-font: major-latin; mso-bidi-font-family: ''Times New Roman''; mso-bidi-theme-font: major-bidi; color: #2a7b88; mso-themecolor: accent1; mso-themeshade: 191; mso-font-kerning: 14.0pt; mso-ansi-language: IN; mso-no-proof: yes;">&nbsp;</span></p>\r\n<div style="mso-element: para-border-div; border: none; border-bottom: solid #39A5B7 1.5pt; mso-border-bottom-themecolor: accent1; padding: 0in 0in 4.0pt 0in;">\r\n<p class="MsoTitle" style="line-height: 150%;"><span lang="IN" style="mso-ansi-language: IN; mso-no-proof: yes;">BAB II : TINJAUAN PUSTAKA</span></p>\r\n</div>\r\n<h1 style="text-align: justify; text-justify: inter-ideograph; line-height: 150%;"><span lang="IN" style="mso-ansi-language: IN; mso-no-proof: yes;">I. Smartphone</span></h1>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph; text-indent: .5in; line-height: 150%;"><span lang="IN" style="color: windowtext; mso-ansi-language: IN; mso-no-proof: yes;">Android adalah sistem operasi berbasis Linux yang di- rancang untuk perangkat seluler layar sentuh seperti telepon pintar dan komputer tablet. Android awalnya dikembangkan oleh Android, Inc., dengan dukungan ?nansial dari Google, yang kemudian membelinya pada tahun 2005. Sistem operasi ini dirilis secara resmi pada tahun 2007, bersamaan dengan didirikannya Open Handset Alliance, konsorsium dari perusahaan-perusahaan perangkat keras, perangkat lunak, dan telekomunikasi yang bertujuan untuk memajukan standar terbuka perangkat seluler. Ponsel android pertama mulai dijual pada bulan Oktober 2008</span></p>\r\n<h1 style="text-align: justify; text-justify: inter-ideograph; line-height: 150%;"><span lang="IN" style="mso-ansi-language: IN; mso-no-proof: yes;">II. Metode Scrum</span></h1>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph; text-indent: .5in; line-height: 150%;"><span lang="IN" style="color: windowtext; mso-ansi-language: IN; mso-no-proof: yes;">Metode Scrum pertama diperkenalkan oleh Jef Sutherland pada awal tahun 1990an. Sebernarnya scrum bukanlah sebagai sebuah teknik untuk membuat produk, melainkan sebuah kerangka kerja dimana didalamnya kita dapat memasukkan berbagai proses dan teknik. Scrum akan menunjukkan hasil dari praktik pengelolaan dan pengembangan produk sehingga dapat menghasilkan produk yang lebih baik. Scrum memiliki beberapa prinsip yaitu:</span></p>\r\n<p class="MsoListBulletCxSpFirst" style="text-align: justify; text-justify: inter-ideograph; line-height: 150%; mso-list: l2 level1 lfo1;"><span lang="IN" style="mso-ascii-font-family: Cambria; mso-fareast-font-family: Cambria; mso-hansi-font-family: Cambria; mso-bidi-font-family: Cambria; color: windowtext; mso-ansi-language: IN; mso-no-proof: yes;"><span style="mso-list: Ignore;">&middot;<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span lang="IN" style="color: windowtext; mso-ansi-language: IN; mso-no-proof: yes;">Ukuran tim yang kecil<span style="mso-spacerun: yes;">&nbsp; </span>melancarkan komunikasi, mengurangi biaya, dan memberdayakan satu sama lain</span></p>\r\n<p class="MsoListBulletCxSpMiddle" style="text-align: justify; text-justify: inter-ideograph; line-height: 150%; mso-list: l2 level1 lfo1;"><span lang="IN" style="mso-ascii-font-family: Cambria; mso-fareast-font-family: Cambria; mso-hansi-font-family: Cambria; mso-bidi-font-family: Cambria; color: windowtext; mso-ansi-language: IN; mso-no-proof: yes;"><span style="mso-list: Ignore;">&middot;<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span lang="IN" style="color: windowtext; mso-ansi-language: IN; mso-no-proof: yes;">Proses dapat beradaptasi terhadap perubahan teknis dan bisnis</span></p>\r\n<p class="MsoListBulletCxSpMiddle" style="text-align: justify; text-justify: inter-ideograph; line-height: 150%; mso-list: l2 level1 lfo1;"><span lang="IN" style="mso-ascii-font-family: Cambria; mso-fareast-font-family: Cambria; mso-hansi-font-family: Cambria; mso-bidi-font-family: Cambria; color: windowtext; mso-ansi-language: IN; mso-no-proof: yes;"><span style="mso-list: Ignore;">&middot;<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span lang="IN" style="color: windowtext; mso-ansi-language: IN; mso-no-proof: yes;">Proses menghasilkan beberapa software increment</span></p>\r\n<p class="MsoListBulletCxSpMiddle" style="text-align: justify; text-justify: inter-ideograph; line-height: 150%; mso-list: l2 level1 lfo1;"><span lang="IN" style="mso-ascii-font-family: Cambria; mso-fareast-font-family: Cambria; mso-hansi-font-family: Cambria; mso-bidi-font-family: Cambria; color: windowtext; mso-ansi-language: IN; mso-no-proof: yes;"><span style="mso-list: Ignore;">&middot;<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span lang="IN" style="color: windowtext; mso-ansi-language: IN; mso-no-proof: yes;">Pembangunan dan orang yang membangun dibagi dalam tim yang kecil</span></p>\r\n<p class="MsoListBulletCxSpMiddle" style="text-align: justify; text-justify: inter-ideograph; line-height: 150%; mso-list: l2 level1 lfo1;"><span lang="IN" style="mso-ascii-font-family: Cambria; mso-fareast-font-family: Cambria; mso-hansi-font-family: Cambria; mso-bidi-font-family: Cambria; color: windowtext; mso-ansi-language: IN; mso-no-proof: yes;"><span style="mso-list: Ignore;">&middot;<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp; ', '2016-11-24 03:50:52');
