INSERT INTO `blog` (`id_blog`, `id_admin`, `title`, `content`, `date_created`) VALUES
(391, 1, '[BBOY] Red Bull BC One World Final Japan 2016', 'Date: December 3, 2016\r\nLocation: Aichi Prefectural Gymnasium, Nagoya, Japan\r\nTime: 5pm-9:30pm\r\nTickets: Ticket sales starts on 28th Oct, 2016\r\n\r\nAs Red Bull BC One enters its 13th year, big changes are on the horizon. In order to open up the event year-round to the wider community, were getting rid of the six regional Finals and replacing them with Red Bull BC One Camps all over the world. Were going back to the core of what breaking is all about: culture. The World Final will once again be invitation only, with the exception of one name to be determined by a Last Chance Cypher where all Cypher winners throughout the year will compete for one open spot that will conclude the line-up.\r\n\r\nOn December 3, the World Final is returning to Japan, this time in the incredible city of Nagoya, the countrys third largest city and a bustling hub for Hip Hop. Sixteen of the best B-Boys on the planet will go head-to-head in knockout battles to determine who will be the one. The event will be broadcast live on Red Bull TV.\r\n\r\nKicking off 2016, camps will be held in countries including France, Italy, Japan, South Africa, and Ukraine, with new countries being announced soon. Check redbullbcone.com for details on a camp near you. These three-day events will include jams, workshops, open battles, talks, exhibitions, theatre shows and more, celebrating Hip Hop, dance and culture. Each will focus on sharing knowledge, making connections and having fun. \r\n\r\nThe camps will reflect the creative landscape of the local scene and will incorporate other elements of Hip Hop, urban dance and creative expression, alongside breaking. They will then culminate in a Red Bull BC One Cypher where the winner will get a chance to battle for a place at the World Final.\r\n\r\nThe World Final is returning to its roots of being invitation only, with one open spot to be determined by a Last Chance Cypher. Throughout 2016, Cyphers will take place in every corner of the globe, with winners being flown to the Last Chance Cypher in Nagoya, to take place on December 1, two days before the World Final.\r\n\r\nThis Last Chance Cypher will represent an incredible cultural exchange as B-Boys will come in from all over the world to prove their skills on the dance floor and battle in an attempt to earn that one coveted spot on the ultimate stage. The winner will compete in the World Final alongside a line-up of Wild Card entries, chosen by an international team of B-Boy experts. \r\n\r\nLast year, millions of spectators tuned in from around the world to see USAs Victor take the belt in Rome. Each year the stakes become higher and the competition tougher, as breakers continue to evolve the art form. It will be an unbelievable week of events not to be missed.\r\n\r\nRed Bull BC One was founded in 2004 in Biel, Switzerland. Over the years, the championship has moved from Germany to Brazil, South Africa, France, the USA, Japan, Russia, South Korea and Italy. Today it remains a key event in Hip Hop culture, helping to push the culture forward while respecting the original format of one-on-one battles.', '2016-10-26'),
(392, 1, '#BCONE Instagram of the Week', 'Who said that breaking and classical music didn''t fit? They do! Check out this amazing shot by wienerhiphopball. Want to be featured as the #BCONE Instagram of the Week? Tag your photos, and we pick the best each Monday!', '2016-10-26'),
(393, 1, 'B-Boy Life on the Road: DJ Lean Rock', 'DJ Lean Rock is no stranger to travel. Since the age of 16, he has been traveling the world consistently as a B-Boy of the world famous Floor Lords crew and as a professional DJ playing for the biggest B-Boy competitions and the Red Bull BC One World Final twice. Just before his upcoming European summer tour, DJ Lean Rock took some time to answer a few questions about his B-Boy Life on the Road\r\n\r\nWhat is your next B-Boy related destination?\r\nOutbreak Europe.\r\n\r\nFirst time in Slovakia?\r\nNo, Ive been to Slovakia over 10 times.\r\n\r\nWho do you leave behind when you go on your next trip?\r\nMy girlfriend and my dog.\r\n\r\nIs it easy or hard for them you being away?\r\nIf its a short trip, then its easy for them. If its a long trip like when I go on a tour for 3 weeks to a month, then its a little tough.\r\n\r\nWhat is your favourite airport?\r\nHmmm. I am not really a fan of airports. For really short lines (within USA), I would say Burbank Airport. For cleanliness, I would say Zurich Airport. For food, I would say Austin and Nashville, really good BBQ.\r\n\r\nI dont leave the house without?\r\nClothes for one haha. My toothbrush, toothpaste and deodorant. If Im DJing, it will be my laptop, Serato box (if needed), headphones, slipmats, Serato records and maybe a few extra records. I used to always have gummy bears too. But now its pistachios.\r\nBest B-Boy related travel companion(s)?\r\nEl Nino, Nasty Ray, Jeremy HK and Keebz because theyre always down for a good time.\r\n\r\nWhat does your upcoming travel to Outbreak Europe look like from door to door?\r\nIts long. It takes me about 45 minutes normally to get to LAX. Then, I fly to Amsterdam for a day, which will take at least 10 hours from L.A. I spend a day in Amsterdam, and I leave the next day to fly to Vienna in Austria, which will be another 2 hours of flying. I have another 3-hour drive from Vienna to Banska Bystrica in Slovakia  the city of Outbreak Europe.\r\n\r\nWhat do you expect from Outbreak Europe this year.\r\nNo sleep and lots of fun.\r\n\r\nOne last travel advice?\r\nFor anyone that hates jet lag, rest well and drink loads of water. I usually drink 2 litres of water before and during long flights. Eat healthy and light before getting on the plane. Dont eat the food on the plane, unless youre in first class. When you get to your destination, make time for sightseeing, meet some locals, eat good food and if youre a DJ like me get some records.\r\n\r\nOutbreak Europe takes place in the city of Banska Bystrica Slovakia from July 29th  31st.', '2016-10-26'),
(394, 1, '8 Indian B-Boys Trace the Journey of the Dance Form', 'What appeals most to me about the art form is its rawness and the freedom to just let go and express a side of you which I never thought existed.\r\n\r\n B-Boy ET (Guatam Jeevan)\r\n\r\n \r\n\r\nThe brewing excitement in the days leading up to Red Bull BC Ones 2016 edition in India is tangible. As the four cities where events will take place prep for the event, we caught up with some of the leading B-Boys in the country. Here, we dig a little deeper and speak to the most dedicated of the lot that has been pushing this form for years now about how the art form came to India and how it has been evolving over the years. Some of the countrys best B-Boys offer advice for the next generation. Read on for more.  \r\nSumit Suvarna, Beast Mode (Mumbai)\r\n\r\nB-Boy Ninja is one of the most iconic names in Indian breaking history, having organized one of the first jams in the country back in 2006. Having trained in New York and California to learn the authentic form of breaking, he is an inspiration for many aspiring B-Boys and B-Girls. \r\n\r\nOn how the B-Boy scene in India has evolved since he first began\r\nThere was no one when we started, and when we would practice on the roads, people used to think we were doing kung fu (laughs). I used to practice outside my house, and a lot of kids would come and watch. Over time, the acceptance grew, especially thanks to the shows on MTV and the Red Bull BC One which opened up B-Boying to a much wider audience.  \r\n\r\nIn Bangalore, the scene was pretty young, and the scene was brought over by kids from Dubai. B-Boy Hotshot is a name you cant ignore, who kicked off the scene in Kolkata, and Kim Mogen from Shillong has fought hard for opportunities in a place where resources are scarce. \r\n\r\nIn Delhi, Heera has been a staunch supporter of b-boying, and has been a mentor to several of the leading B-Boys of today. In Mumbai, Gautam ET Jeevan is leading the game. He started off as Indias first popper, and now hes a B-Boy, too.\r\n\r\nSocial media has also changed a lot, making it easier for aspiring B-Boys to work on their techniques in a way we couldnt do before. \r\n\r\nSome advice for the new generation of B-Boys\r\nJust create, dont imitate. The best dancers have got their own unique styles. Indians need to find their own. We have just been blindly copying other styles, and thats why were not growing. \r\nGautam Jeevan, Freak n Stylz (Mumbai)\r\n\r\nB-Boy ET got into B-Boying when he came across a music video featuring the art form, by RUN DMC, and theres been no looking back since. He has been a dedicated student of the art, constantly researching the origins of the dance form. He''s also one of the first members of Freak n Stylz Crew, the first crew to be formed in India, which is now nine years old. They were closely followed by the UDK crew, as the second ones in the country, with Paritosh at the helm.\r\n\r\nOn how the B-Boy scene in India has evolved since he first began \r\nThe scene began with no more than five to six B-Boys back when I started. It has grown to thousands across the country now.We had one or two jams back in the day which we organized ourselves and called friends and fellow B-Boys to support us. And now, there are major events with international judges happening every month.\r\n\r\nThe biggest shortcoming for B-Boying in the country, in all honesty, is that 90% of the B-Boys are in their teens or early 20s so they are exploited by corporate houses, Bollywood, event organizers etc. Theyre also not paid well as most B-Boys are often just hunting to make a quick buck, and this is what destroys the market completely.\r\n\r\nSome advice for the new generation of B-Boys\r\nNever forget why you started dancing  it was never to win competitions but for a feeling you get when you dance which makes you happy.\r\n\r\nRespect the B-Boys who have paved the way for you  if it wasn''t for them, you probably wouldn''t have been attracted to the art in the first place.\r\n\r\nKnow your worth  if you want to make money through B-Boying, command it through your skills and behavior. Don''t be a sellout.\r\nKim Mugen, Tribal Beatz Crew (Shillong)\r\n\r\nB-Boy Kim started off as one of the core members of Mizorams Tribal Beatz Crew, and has been a pioneer and promoter of B-Boy culture in the North-Eastern states. His zeal for breaking gives him a sense of purpose and strength he builds on every day, and hes been going strong for more than five years. \r\n\r\nOn how the B-Boy scene in India has evolved since he first began\r\nWell, in a worldly perspective, it has grown. Jams and shows happen on a far more regular basis compared to the time I started out. The B-Boy movement is a complex and highly expressive one, and the number of participants has been growing in this culture.\r\n\r\nHip Hop can sometimes have a very negative impact as well, with gang culture and drug use influence. I just don''t want my brothers to go down a path they will regret; this dance should be for spiritual growth and lead into the direction of Truth.\r\n\r\nSome advice for the new generation of B-Boys\r\nFind yourself, seek truth.\r\n\r\nBe careful in following false role models and false doctrines of this culture.\r\n\r\nSeek the Holy Spirit and the bible for advice.\r\n\r\nMatthew 4:4 Man does not live on food alone but by every word of God.\r\n\r\n4_edit.jpg\r\nNaser Azzeh, Black Ice Crew (Bangalore)\r\n\r\nB-Boy Nas was inspired to try breaking because of videos he came across on YouTube that had gone viral. With a lot of hard work and determination, his crew started imitating what they saw and have now developed their own styles and started to create their own moves.  \r\n\r\nOn how the B-Boy scene in India has evolved since he first began\r\nThe scene in India was very small eight years ago, and we have come a long way since then. Personally, I feel Bangalore welcomed this culture in with open arms, as we have the highest number of jams happening per year in India. It''s growing quickly and it isn''t gonna slow down any time soon!\r\n\r\nSome advice for the new generation of B-Boys\r\nTake your time to learn the foundation of the dance and the history because that''s the most important thing. \r\n\r\nEverything has to be built strong from the start. \r\n\r\nGive everything you have to Hip Hop, and Hip Hop will return great things to you in the future!\r\nLikith Achaiah, Black Ice Crew (Bangalore)\r\n\r\nFirst introduced to B-Boying in high school by a student who had returned to India from Dubai, Likith got into the art much later. With Black Ice Crew being formed in 2008, his passion for the art form grew, and some important challenges hes faced along the way include the lack of studio space to practice, family support and adequate training and guidance. \r\n\r\nOn how the B-Boy scene in India has evolved since he first began\r\nThe scene has evolved exponentially. Dancers are well connected through social media, and there are many events and jams that happen all across the country which help dancers grow.Shortcomings in the space would include a lack of investors, promoters and sponsors for privately-organized jams. \r\n\r\nSome advice for the new generation of B-Boys\r\nTrain hard and also take your time to understand the dance and culture. \r\n\r\nTry to be original. \r\n\r\nDon''t forget to warm up before practice.\r\nJayanta Samaddar, Break Guruz (Kolkata)\r\n\r\nB-Boy Hotshot believes he is an artist first, then a dancer, then a B-Boy. Art came first, then dancing in general (inspired by Michael Jackson), and eventually, he discovered breaking in 2008, when he was 16. Completely self-taught, he started out at a time when there were no more than 10-15 B-Boys, and Break Guruz, the crew he co-founded, is one of the first crews of India formed in June of 2008. \r\n\r\nWhat I like about the crew is, we don''t just share dance and go back home. We share life, as B-Boys and beyond B-Boys. To me, that is the essence of the philosophy of the B-Boy... we don''t just break, but we live life with that philosophy of a B-Boy. That is what Break Guruz means. \r\n\r\nOn how the B-Boy scene in India has evolved since he first began\r\nHailing from a small town called Bhadreshwar, 40 kms from Kolkata, I had to fight societal stereotypes. I think a reason why my B-Boy style is the way it is, is because I have fought these stereotypes all my life. \r\n\r\nWe carried a rivalry with Freak n Stylz crew, a score which needed to be settled. So, we travelled to Mumbai in 2009 to battle them, along with other B-Boys from Chandigarh and Jalandhar. To me, this is the single most important event in Indian B-Boy history. For the first time, B-Boys of India travelled across cities and states for Hip Hop, out of curiosity to know about other B-Boys, and to test our skills against theirs.\r\n\r\nTeaching myself was also a challenge, but that hunger that arose out of the energy of the dance and love for Hip Hop music saw me through. I trained eight hours a day and I believe I''m just getting better and evolving. Now, I pop as well.\r\n\r\nSome advice for the new generation of B-Boys\r\nThere is a lack of diversity, and many B-Boys are similar to some famous B-Boys. Originality thrives in isolation. I don''t mean to say be physically isolated, but mentally you should reject the impulse to do what others are doing.\r\n\r\nYou need to pause and dig deep. Indian B-Boys, grew up in a different environment than the original B-Boys in the Bronx. Unless you dig deep, you cannot accurately represent that idea that you want to represent in the first place.\r\n\r\nStudy great artists. To bring something new to the table, you need to look outside the table. Do something apart from breaking to draw inspiration from. Play an instrument, a sport, anything.\r\n\r\n3_edit.jpg\r\nNaresh Gopal, Third Eye Crew (Chennai)\r\n\r\nB-Boy Nash kicked off his career as a professional dancer when he was 16, inspired by watching B-Boy Gonza from 99 Flavour, Thailand, and he cites B-Boy Bunny (Roc Fresh Crew) as his inspiration closer to home, along with Pravin and Bala from Fifth Element Crew, Chennai. He flew to Thailand, Malaysia and Bangkok for professional training, to which he dedicated a few years, and then started his own crew in India, the Third Eye Crew.\r\n\r\nOn how the B-Boy scene in India has evolved since he first began\r\nThough B-Boying isnt a part of Indian dance traditionally, people here are so interested in and crazy about this style. Even the less-educated people who have had less exposure, perhaps from a lower socio-cultural strata, are showing more interest towards this style, and Im sure this is going to reach Himalayan heights.  \r\n\r\nSome advice for the new generation of B-Boys\r\nNo break to break.\r\n\r\nBe disciplined on the floor, and a Charlie Chaplin among all.\r\n\r\nFollow the creator, not the creation. \r\n\r\n1.jpg\r\nBharat Rajodiya, Tandav (New Delhi)\r\n\r\nB-Boy Rawdrs fascination of B-Boying grew from the first time he came across the dance form. His crew Tandav was formed in 2010, with six other co-founding members from different areas of the capital. \r\n\r\nOn how the B-Boy scene in India has evolved since he first began\r\nI feel it is now that India is really being put on the map, in terms of B-Boying. The Internet has really made a great difference and given us a platform to discover as well as show the world our skills. Freaknstylz and Roc Fresh Crew have been doing some great work since 2006, and thats how I discovered the art form. \r\n\r\nWhen we started out, we had to find like-minded people without any sort of reference. The only thing we had was Orkut, and we used that to network to a certain extent. We were among the first to organize jams in the city, and now, we have massive competitions like Red Bull BC One; the change is immense.  \r\n\r\nSome advice for the new generation of B-Boys\r\nThere is no originality. The only reason India is being held back is because the new generation is only aping the styles of other. Korea, for example, has a B-Boy scene that flourished in five years. We need to work on our own unique styles to really make an impact.Dont do it if you just want to imitate others. There are a few kids who are crazy and original, and Im counting on them to carry the legacy forward. \r\n\r\nText by Aditi Dharmadhikari', '2016-10-26');
