man'',''serif''; mso-fareast-font-family: ''Times New Roman'';"><span style="mso-list: Ignore;">1.1.</span></span></strong><strong style="mso-bidi-font-weight: normal;"><span style="font-size: 12.0pt; line-height: 107%; font-family: ''Times New Roman'',''serif'';"> Latar Belakang</span></strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent: 0.5in; text-align: justify;"><span style="font-size: 12.0pt; line-height: 107%; font-family: ''Times New Roman'',''serif'';">Dalam dunia teknologi informasi masa kini banyak di kalangan remaja sampai dewasaYang membutuhkkan teknologi informasi sebagai pendamping untuk memenuhi kebutuhan Sehari &ndash; hari baik itu kebutuhan premier maupun kebutuhan sekunder. Dan banyak dari mereka yang memanfaatkan informasi teknologi sebagai alat pencaharian uang untuk kelangsungan hidup mereka, dengan menggunakan website sebagai perantaranya, banyak yang bisa di garap melalui web salah satu nya adalah menggunakan media web sebagai penampung usaha perbisnisan online shop dengan ini masyarakat dapat dengan mudah melakukan transaksi dengan pembeli dan pembeli dapat dengan mudah memilih produk yang akan dibeli karena produk nya sudah di buat sampel yang diletakkan kedalam web tersebut, web tersebut dapat di miliki oleh setiap orang tanpa ada ketentuan ketentuan hokum didalam nya , maka dengan itu masyarakat dapat dengan bebas memulai perbisnisan mereka dan mensejahterakan keluarga dengan mata pencaharian dengan basis website tersebut. Namun terdapat masalah dalam kemajuan teknologi informasi berbasis web tersebut, dikarenakan domain .com yang dapat dibeli oleh kalangan masyarakat dari semua kalangan maka tidak ada hambatan bagi mereka yang ingin menggunakan domain tersebut hanya untuk sekedar coba coba saja, dari berbagai perspektif pada kata &ldquo;coba-coba&rdquo; mungkin tidak terdengar bahaya bagi kita yang awam, tapi pada kenyataannya web tersebut yang bersifat domain berbayar dapat dilihat oleh semua orang dan dapat menggunakan fitur yang sangat banyak. Kaitan nya dengan penggunaan usaha perdagangan online shop yaitu, mereka dapat dengan bebas memasarkan barang-barang yang tidak valid atau tidak sesuai dengan apa yang mereka pasarkan seperti hal nya di dalam web tersebut orang-orang dapat terlena dengan deskripsi iklan dari sang penjual tersebut, dan si penjual dapat dengan mudah membuat aneka ragam cara untuk menipu si pembeli, dengan memalsukan barang yang dipasarkan karena barang yang di dalam web itu bersifat fana atau tidak nyata, selain itu si penjual web illegal tersebut dapat memalsukan keamanan transfer uang dengan ATM, yang memungkinkan kita sebagai pembeli merasa yakin kalau cara transfer yang di gunakan baik adanya.</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent: 0.5in; text-align: justify;"><span style="font-size: 12.0pt; line-height: 107%; font-family: ''Times New Roman'',''serif'';">&nbsp;</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent: 0.5in; text-align: justify;"><span style="font-size: 12.0pt; line-height: 107%; font-family: ''Times New Roman'',''serif'';">&nbsp;</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent: .5in;"><span style="font-size: 12.0pt; line-height: 107%; font-family: ''Times New Roman'',''serif'';">&nbsp;</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: .75in; mso-add-space: auto; text-indent: -.25in; mso-list: l1 level2 lfo1;"><strong style="mso-bidi-font-weight: normal;"><span style="font-size: 12.0pt; line-height: 107%; font-family: ''Times New Roman'',''serif''; mso-fareast-font-family: ''Times New Roman'';"><span style="mso-list: Ignore;">1.2.</span></span></strong><strong style="mso-bidi-font-weight: normal;"><span style="font-size: 12.0pt; line-height: 107%; font-family: ''Times New Roman'',''serif'';"> Rumusan Masalah</span></strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: .75in; mso-add-space: auto;"><strong style="mso-bidi-fo